import base64
import zlib
import sys
db=zlib.decompress(base64.b64decode("".encode('ascii'))).decode('ascii')
sys.setrecursionlimit(int(1e5))
root=dict()
S = [root]
ptr = 0
while ptr < len(db):
  if db[ptr].isdigit():
    dd = ''
    while ptr < len(db) and db[ptr].isdigit():
      dd += db[ptr]
      ptr+=1
    for i in range(int(dd)):
      S.pop()
  else:
    nxt=S[-1].setdefault(db[ptr],{})
    S.append(nxt)
    ptr += 1
M=[list(input().split()) for _ in range(5)]
A=0
def check(word):
  global A
  global M
  vis = [[0 for _ in range(5)] for _ in range(5)]
  def dfs(u,v,i):
    if i == len(word):
      return True
    for dx in range(-1,2):
      for dy in range(-1,2):
        x = u+dx
        y = v+dy
        if x < 0 or x >= 5 or y < 0 or y >= 5:
          continue
        if vis[x][y]:
          continue
        if M[x][y] != word[i]:
          continue
        vis[x][y] = 1
        if dfs(x,y,i+1):
          return True
        vis[x][y] = 0
    return False
  for i in range(0,5):
    for j in range(0,5):
      if M[i][j] == word[0]:
        vis[i][j] = 1
        if dfs(i,j,1):
          A += 1
          return
        vis[i][j] = 0
words = [] 
def dfs(word, cur):
  for k, v in cur.items():
    if k == '@':
      words.append(word)
    else:
      dfs(word+k, v)
dfs('', root)
for word in words:
  check(word)
print(A)
